  Center,
  Input,
  Box,
  Button
} from '@chakra-ui/react'

import { login } from '../services/login'
import { ButtonLogin } from './Button/Button'
import { useState } from 'react';
export const Card = () => {
  const [email, setEmail] = useState<string>('');
  const [password, setPassword] = useState<string>('');
  return (

    <Box minHeight='100vh' backgroundColor='#B9E6F6' padding='25px'>
      <Box backgroundColor='#FFFFFF' borderRadius='25px' padding='15px' >
        <Center>
          <h1>Fa√ßa o login</h1>
        </Center>
        <Input placeholder="e-mail" type="email" onChange={(event) => setEmail(event.target.value)} />
        <Input placeholder="senha" type="password" onChange={(event) => setPassword(event.target.value)} />
        <Center>
          {/* <Button onClick={login} colorScheme='teal' size='sm' width='100%' marginTop='5px'>
            Button
          </Button> */}

          <ButtonLogin login={() => login({ email, password })}></ButtonLogin>
        </Center>
      </Box>
    </Box>
  )
}
